-- Миграция: Упрощение структуры таблиц самолётов и добавление данных из исходного файла
-- Версия: 053

BEGIN;

-- ============================================
-- ПЕРЕИМЕНОВАНИЕ ТАБЛИЦЫ
-- ============================================

-- Переименовываем таблицу manufacturers в aircraft_manufacturers
ALTER TABLE IF EXISTS manufacturers RENAME TO aircraft_manufacturers;

-- Переименовываем индекс
ALTER INDEX IF EXISTS idx_manufacturers_name RENAME TO idx_aircraft_manufacturers_name;

-- Обновляем внешний ключ в aircraft_models
ALTER TABLE aircraft_models DROP CONSTRAINT IF EXISTS aircraft_models_manufacturer_id_fkey;
ALTER TABLE aircraft_models ADD CONSTRAINT aircraft_models_manufacturer_id_fkey FOREIGN KEY (manufacturer_id) REFERENCES aircraft_manufacturers(id) ON DELETE CASCADE;



-- ============================================
-- УПРОЩЕНИЕ СТРУКТУРЫ ТАБЛИЦ
-- ============================================

-- Удаляем лишние поля из aircraft_manufacturers
ALTER TABLE aircraft_manufacturers DROP COLUMN IF EXISTS country;
ALTER TABLE aircraft_manufacturers DROP COLUMN IF EXISTS website;
ALTER TABLE aircraft_manufacturers DROP COLUMN IF EXISTS description;
ALTER TABLE aircraft_manufacturers DROP COLUMN IF EXISTS is_active;
ALTER TABLE aircraft_manufacturers DROP COLUMN IF EXISTS created_at;
ALTER TABLE aircraft_manufacturers DROP COLUMN IF EXISTS updated_at;

-- Удаляем лишние поля из aircraft_models
ALTER TABLE aircraft_models DROP COLUMN IF EXISTS full_name;
ALTER TABLE aircraft_models DROP COLUMN IF EXISTS category;
ALTER TABLE aircraft_models DROP COLUMN IF EXISTS engine_type;
ALTER TABLE aircraft_models DROP COLUMN IF EXISTS engine_count;
ALTER TABLE aircraft_models DROP COLUMN IF EXISTS is_active;
ALTER TABLE aircraft_models DROP COLUMN IF EXISTS created_at;
ALTER TABLE aircraft_models DROP COLUMN IF EXISTS updated_at;

-- Удаляем лишние индексы
DROP INDEX IF EXISTS idx_aircraft_manufacturers_active;
DROP INDEX IF EXISTS idx_aircraft_manufacturers_country;
DROP INDEX IF EXISTS idx_aircraft_models_category;
DROP INDEX IF EXISTS idx_aircraft_models_active;
DROP INDEX IF EXISTS idx_aircraft_models_full_name;

-- Удаляем триггеры
DROP TRIGGER IF EXISTS update_aircraft_manufacturers_updated_at ON aircraft_manufacturers;
DROP TRIGGER IF EXISTS update_aircraft_models_updated_at ON aircraft_models;

-- ============================================
-- ОЧИСТКА ДАННЫХ
-- ============================================

DELETE FROM aircraft_models;
DELETE FROM aircraft_manufacturers;

-- ============================================
-- ДОБАВЛЕНИЕ ПРОИЗВОДИТЕЛЕЙ
-- ============================================


-- ============================================
-- ДОБАВЛЕНИЕ МОДЕЛЕЙ
-- ============================================


COMMIT;